Two young couples sharing one another physically, being free, open to express their physical desires. It's not love, it's pure, undiluted lust that drives them.

Martin takes Richards girl in his arms, as their craving for each other grows, their impulses take over and their inner beings intertwine. It's powerful watching their feelings take over, as new flesh is explored, him inside her, her enveloping him.

Richard watches his girl lose herself in the moment, smiling all the while, for he gets to enjoy Emma, who has devoted herself emotionally to Martin. For this precious moment she is his to enjoy physically. Emma is excitable, the thought of this new man up inside her makes her wet with anticipation.

Fun, beautiful, passionate, we hope our members enjoy this foursome as much as the two couples enjoyed it!
